import "../hojas-de-estilo/SearchBar.css";
export default function SearchBar({onSearch}) {
   return (
      <div className="barra-de-navegacion">
         <input type='search' />
         <button 
            className="aceptar"
            onClick={onSearch}
         >Agregar</button>
      </div>
   );
}
